			if (!window.requestAnimationFrame)

		function getPosition(e) {
			var rect = e.target.getBoundingClientRect();
			var x = -1;
			var y = -1;
			if ((e.clientX != undefined) && (e.clientX != undefined)) {
				x = e.clientX - rect.left;
				y = e.clientY - rect.top;
			} else
				if (e.touches != undefined)
					if (e.touches.length > 0) {
						x = e.touches[0].clientX - rect.left;
						y = e.touches[0].clientY - rect.top;

						x = e.changedTouches[0].clientX - rect.left;
						y = e.changedTouches[0].clientY - rect.top;
					}
			x=Math.round(x);
			y=Math.round(y);
			return (x + ':' + y);

		var pos_text, canvas, ctx;

		var posX = 0n, posY = 0n, posZ = onen/4n*5n, all_tileset_info = [];

		i_img.onload = function() {
			i_img_loaded=!0;
		};
		i_img.src = 'all.png';
		
		function onload()
		{
			pos_text=document.getElementById('pos_text');
			canvas=document.getElementById('canvas');
			ctx = canvas.getContext("2d", { alpha: false,antialias: false, depth: false,desynchronized:true});			
			
			
			canvas.addEventListener('mousemove', mouse_move);
			canvas.addEventListener("touchmove", mouse_move);
			canvas.addEventListener('mousedown', mouse_down);
			canvas.addEventListener("touchstart", mouse_down);
			canvas.addEventListener('mouseup', mouse_up);
			canvas.addEventListener("touchend", mouse_up);
			canvas.addEventListener('mouseout', mouse_up);
			canvas.addEventListener("touchcancel", mouse_up);

			if (canvas.addEventListener) {
				if ('onwheel' in document) {
					// IE9+, FF17+, Ch31+
					canvas.addEventListener("wheel", mouse_wheel);
				} else if ('onmousewheel' in document) {
					// устаревший вариант события
					canvas.addEventListener("mousewheel", mouse_wheel);
				} else {
					// Firefox < 17
					canvas.addEventListener("MozMousePixelScroll", mouse_wheel);
				}
			} else { // IE8-
				canvas.attachEvent("onmousewheel", mouse_wheel);
			}
			
			rec_info=rec_info.split(';').map(x=>x.split(':').map(y=>y.split(' ').map(z=>parseInt(z,16))));
			for (var i=0;i<rec_info.length;i++)
			{
				all_tileset_info.push({});
				all_tileset_info[i].x= i % 5;
				all_tileset_info[i].y= Math.floor(i / 5);
				all_tileset_info[i].recurs=rec_info[i];

						do{
							all_tileset_info[i].recurs[j][k]=Math.floor(Math.random()*10);
						} while(all_tileset_info[i].recurs[j][k]==i)
					}
				}*/
			}
			console.log(rec_info);
			
			pool_update();
			pr_pos();
			requestAnimationFrame(render);
		}
		var mousestatus = false;
		var mouselastX = 0;
		var mouselastY = 0;
		var scale=1n;
		function mouse_wheel(e) {
			e = e || window.event;
			var delta = e.deltaY || e.detail || e.wheelDelta;
			var ua = navigator.userAgent;
			
			if (ua.search(/Chrome/) > 0)
				delta=-delta;
			if (delta<0)
				posZ=posZ*100n/75n;
			else
				posZ=posZ*75n/100n;
			if (posZ>5n*onen)
			  posZ=5n*onen;
			while (posZ<10n**20n)
			{
				onen*=10n;
				posX*=10n;
				posY*=10n;
				posZ*=10n;
			}
			pr_pos();
			e.preventDefault ? e.preventDefault() : (e.returnValue = false);
			pool_update();
		}
		function mouse_down(e)
		{
			mousestatus = true;
			mouselastX = parseFloat(getPosition(e).split(':')[0]);
			mouselastY = parseFloat(getPosition(e).split(':')[1]);
			mouse_move(e);
			pool_update();
		}
		function mouse_move(e)
		{
			var positionx = parseFloat(getPosition(e).split(':')[0]);
			var positiony = parseFloat(getPosition(e).split(':')[1]);
			if (mousestatus) {
				posX+=BigInt(positionx - mouselastX)*posZ/scale;
				posY+=BigInt(positiony - mouselastY)*posZ/scale;
				pr_pos();
			}
			mouselastX = positionx;
			mouselastY = positiony;
		}
		function mouse_up(e)
		{
			if (mousestatus == true)
				pr_pos();
			mousestatus = false;
			pool_update();
		}
		function BigIntToStr(n)
		{
			if (n<0)
				return '-'+BigIntToStr(-n);
			if (n % onen==0n)
				return ''+(n / onen);
			return ''+(n/onen)+('.'+(onen+n % onen)).replace(/[0]*$/gi,'').replace('1','');
		}
		function pr_pos()
		{
			//console.log(posX,posY,posZ);
			pos_text.innerHTML='X: <input type="text" style="vertical-align:middle;width:calc(100% - 50px);" value="'+BigIntToStr(posX)+'"><br>Y: <input style="vertical-align:middle;width:calc(100% - 50px);" type="text" value="'+BigIntToStr(posY)+'"><br>Z: <input style="vertical-align:middle;width:calc(100% - 50px);" type="text" value="'+BigIntToStr(posZ)+'">';
		}
		function rectanglesIntersect(minAx, minAy, maxAx, maxAy, minBx, minBy, maxBx, maxBy) {
			if (minAx>maxAx)
				console.log('err');
			return maxAx >= minBx && minAx <= maxBx && minAy <= maxBy && maxAy >= minBy;
		}
		function pool_update()
		{
			var stack=[[0,-5n*onen/10n, -5n*onen/10n, onen]];
			draw_pool=[];
			var t=1000;
			while (stack.length)
			{

				//stack.splice( index, 1 );

				//{
					//console.log('1');
				//	continue;
				//}
				draw_pool.push([e[1], e[2], e[3], e[3], all_tileset_info[e[0]].x, all_tileset_info[e[0]].y]);
				//if (posZ/e[3]>50n)  // слишком маленький
				//{
					//draw_pool.push([e[1], e[2], e[3], e[3], all_tileset_info[e[0]].color]);
					//console.log('2');
				//	continue;
				//}
				if (posZ/100n*40n>e[3])
					continue;
				for (var i=0;i<25;i++)
				{
					for (var j=0;j<25;j++)
					{
						var e2=[all_tileset_info[e[0]].recurs[j][i],e[1]+e[3]*BigInt(i)/25n,e[2]+e[3]*BigInt(j)/25n,e[3]/25n];
						//	break;
						if (rectanglesIntersect(-posX-posZ/2n,-posY-posZ/2n,-posX+posZ/2n,-posY+posZ/2n,e2[1],e2[2],e2[1]+e2[3],e2[2]+e2[3]))
								stack.push(e2);
					}
				}
				//	continue;
				/*var k=onen/100n;
				while (k>0n)
				{
					draw_pool.push([-5n*onen/10n, -5n*onen/10n, k, k, "#FFF"]);

			}

					return -1;
				}
				// a должно быть равным b
				return 0;
			});*/
			//draw_pool=[];
		}
		var draw_pool=[];
		function render()
		{
			//pos_text.innerHTML='123';
			if (canvas.clientHeight != canvas.height || canvas.clientWidth != canvas.width) {
				canvas.height = canvas.clientHeight;
				canvas.width = canvas.clientWidth;
			}
			scale = BigInt(Math.round(Math.max(canvas.width,canvas.height)));
			ctx.fillStyle = "#4f51bf";
			ctx.fillRect(0, 0, canvas.width, canvas.height);
			//if (i_img_loaded)
				//ctx.drawImage(i_img, 0, 0);
			if (i_img_loaded)
				for (var i=0;i<draw_pool.length;i++)
				{
					//if (ctx.fillStyle != draw_pool[i][4])
					//	ctx.fillStyle = draw_pool[i][4];
					DrawMyImg(draw_pool[i][0], draw_pool[i][1], draw_pool[i][2], draw_pool[i][3], draw_pool[i][4], draw_pool[i][5]);
				}
			requestAnimationFrame(render);
		}
		function BigInt2Num(n) {return Number(10000n*n/onen)/10000};
		function DrawMyImg(a, b, c, d, x, y) {
			if (c/posZ>100n)
				return;
			if (d/posZ>100n)
				return;
			ctx.drawImage(i_img,x*100,y*100,100,100, BigInt2Num((posX+a)*onen*scale/posZ)+canvas.width/2, BigInt2Num((posY+b)*onen*scale/posZ)+canvas.height/2, BigInt2Num(c*onen*scale/posZ), BigInt2Num(d*onen*scale/posZ));
			//ctx.fillRect(BigInt2Num((posX+a)*onen*scale/posZ)+canvas.width/2, BigInt2Num((posY+b)*onen*scale/posZ)+canvas.height/2, BigInt2Num(c*onen*scale/posZ), BigInt2Num(d*onen*scale/posZ));
		}
		function DrawMyRect(a, b, c, d) {
			if (c/posZ>100n)
				return;
			if (d/posZ>100n)
				return;
			ctx.fillRect(BigInt2Num((posX+a)*onen*scale/posZ)+canvas.width/2, BigInt2Num((posY+b)*onen*scale/posZ)+canvas.height/2, BigInt2Num(c*onen*scale/posZ), BigInt2Num(d*onen*scale/posZ));
